import React, { Component } from "react";
import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap';
// menu bar icon 
import { FaInbox,FaDelicious,FaSign,FaLock,FaTools,FaPhabricator,FaSearch } from "react-icons/fa";
import Header from "./Style/Header";
import {Link} from 'react-router-dom';

export default class Navbar extends Component {

  render() {
    return (
      <div className="hed-ing">
          <Header />
     {/*------------------- top nvbar -------------------------*/}
      <div className="top-nav-bar">
        <div className="search-box" style={{paddingLeft:"2%"}}>
            <input type="text" className="form-control" />
            <span className="input-group-text"><FaSearch className="fontawesome fa-search" /></span>
        </div>

        <div className="menu-bar">
            <ul>
                <li>
                  <Link to="/" className="nav-link"><FaInbox className="fontawesome" /><br />Home</Link>
                </li>
                <li>
                  {/* <a href="./App_testing_service.jsx"> AboutUs</a> */}
                  <Link to="/about" className="nav-link">About</Link>
                </li>
                <li>
                  {/* <a href="./"><FaTools className="fontawesome" /><br /> Services</a> */}
                  <Link to="/about" className="nav-link">Services</Link>
                </li>

                <li>
                    {/* <a href="/"><FaPhabricator className="fontawesome" /><br /> </a> */}
                    <Link to="/about" className="nav-link">Technology</Link>
                </li>

                <li>
                    {/* <a href="/"><FaSign className="fontawesome" /><br /> </a> */}
                    <Link to="/about" className="nav-link">SignUp</Link>
                </li>

                <li>
                    {/* <a href="/"><FaLock className="fontawesome" /><br /> </a> */}
                    <Link to="/about" className="nav-link">LogIn</Link>
                </li>
            </ul>
        </div>

    </div>
      </div>
    );
  }
}
